import style from './CardsContainer.module.css';
import Card from '../Card/Card';
import { useSelector } from 'react-redux';

const CardsContainer = ({pokemons}) => {
    const { actualPage, pokemonPerPage } = useSelector(state => state)

    const start = (actualPage - 1) * pokemonPerPage;
    const end = start + pokemonPerPage;

    const showPokemons = pokemons?.slice(start, end) 

    return(
        <div className={style.container}>
           {
                showPokemons.map(pokemon => {
                    return <Card 
                        key={pokemon.id}
                        id={pokemon.id}
                        name={pokemon.name}
                        image={pokemon.image}
                        types={pokemon.types} 
                    />
            })}
            
        </div>
    )
}

export default CardsContainer;
